import React from 'react';
import { Route, Switch, Redirect } from 'react-router-dom';

import Login from './pages/Login';
import Tasks from './pages/Tasks';
import NotFound from './pages/PageNotFound';

function App() {
  return (
    <Switch>
      <Route path='/'>
        <Redirect to='/Task'></Redirect>
      </Route>
      <Route path='/Login'>
        <Login />
      </Route>
      <Route path='/Task'>
        <Tasks />
      </Route>
      <Route path='*'>
        <NotFound />
      </Route>
    </Switch>
  );
}

export default App;
